window.RefData_Training = [{"Title":"Alteryx Designer Advanced Certification Exam Preparation","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Learn what to expect on the Alteryx Designer Advanced Certification exam and which resources are available to help you prepare. You will get an overview of the Designer tools covered; the types of questions that appear in the Advanced exam; tips and tricks; and also work through some sample questions. ","Target Audience":"This course is designed for anyone Alteryx Designer Core Certified who has continued to elevate their Alteryx skills and wants to take the Advanced Certification exam. ","Prerequisites ":"A licensed copy of Alteryx Designer. \n\nProficiency in advanced data prep, parsing, apps, macros, and spatial tools is essential. \n\nThe Alteryx Designer Core Certification must be completed and passed before taking the Alteryx Designer Advanced Certification exam. ","Learning Objectives ":"List the tools, topics, and requirements of the Alteryx Designer Advanced Exam. \n\nIdentify the best practices and techniques to prepare for and take the exam. ","Created By":"Esther Matthews"},{"Title":"Alteryx Designer Core Certification Exam Preparation ","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Learn what to expect on the Alteryx Designer Core Certification exam and which resources are available to help you prepare. You will get an overview of the Designer tools covered; the types of questions that appear in the exam; tips and tricks; and then work through some sample questions.","Target Audience":"This course is designed for anyone who wants to learn more about and will attempt to pass the Alteryx Designer Core Certification exam. ","Prerequisites ":"A licensed copy of Alteryx Designer. \n\nProficiency in basic data preparation, transformation, manipulation, and general Alteryx knowledge is essential. ","Learning Objectives ":"List the tools, topics, and requirements of the Alteryx Designer Core exam. \n\nIdentify the best practices and techniques to prepare for and take the exam. ","Created By":"Esther Matthews"},{"Title":"Alteryx Server Administration Foundations ","Duration":"01:30","Solutions":"[\"Server\"]","Description":"This course will teach you the fundamentals of how to perform the tasks of an Alteryx Server administrator. \n\nThroughout this course, you will learn about the roles and permissions of Alteryx Server users and how to manage Server use. You will explore the Server interface and discover how to manage workflows, schedules, credentials, and data connections. ","Target Audience":"his course is designed for anyone who wants to become an Alteryx Server administrator.","Prerequisites ":"Experience using Alteryx Server is recommended. ","Learning Objectives ":"Navigate the Server interface for administrators. \n\nIdentify user roles, permissions, and settings for Server. \n\nManage Server users, workflows, schedules, credentials, and data connections. ","Created By":"Esther Matthews"},{"Title":"Apply Advanced Data Preparation Techniques with Multi-Tools","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Take your data preparation skills to the next level in this course for experienced users. Learn how to streamline complex processes using the Multi-Field Formula, Multi-Row Formula, and Join Multiple tools. Through a practical, real-world scenario, you will conquer a challenging dataset and solve critical business questions. Discover advanced techniques that will revolutionize your workflow efficiency! ","Target Audience":"This course is designed for experienced Designer users looking to enhance their data preparation workflows with advanced tools and techniques. ","Prerequisites ":"A licensed copy of Alteryx Designer. \n\nProficiency in foundational data prep tasks such as filtering, joining, and using basic formulas in Designer. \n\nFamiliarity with the RegEx tool and Regular Expressions. ","Learning Objectives ":"Parse messy data with the Regular Expression (RegEx) tool. \n\nEfficiently process data vertically and horizontally with Multi-Tools. ","Created By":"Esther Matthews"},{"Title":"Automate Data Validation in Your Workflows","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Do you build large workflows that join multiple datasets together? Learn how to insert checkpoints in your workflows that automate tracking and testing to ensure your data is accurate, clean, and easy to troubleshoot.","Target Audience":"This course is designed for experienced Designer users who build complex workflows and want to learn how to add checkpoints for automated tracking, testing, and troubleshooting. ","Prerequisites ":"A licensed copy of Alteryx Designer.  ","Learning Objectives ":"Validate data dynamically in workflows by using automated tracking and testing checkpoints.","Created By":"Esther Matthews"},{"Title":"Automate Processes with Iterative Macros","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Ready to take your macro-building skills to the next level with automation? This advanced course focuses on iterative macros, allowing you to run a process repeatedly until the desired outcome is achieved. Having prior knowledge of standard or batch macros is highly recommended to enhance your learning experience in this course.","Target Audience":"This course is designed for experienced Designer users who are familiar with standard or batch macros and want to expand their automation skills by learning to build iterative macros. ","Prerequisites ":"A licensed copy of Alteryx Designer.  \n\nFamiliarity with the Interface tools palette and creating Macros in Designer. ","Learning Objectives ":"Create a macro that iterates a process until the data meets your desired conditions. ","Created By":"Esther Matthews"},{"Title":"Balance a Modern Governance Framework ","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"How can organizations best govern their analytics workflows? This course introduces a modern, adaptable governance framework designed to strike the right balance between flexibility and control. You’ll learn how to maintain the agility of Alteryx while applying structured governance for sensitive data and repeatable processes. ","Target Audience":"This course is ideal for individuals seeking to implement effective governance in Alteryx workflows without sacrificing flexibility or control. ","Prerequisites ":"A licensed copy of Alteryx Designer Desktop. \n\nProficiency in using Designer Desktop. ","Learning Objectives ":"Apply governance best practices to effectively manage, document, and share workflows in Alteryx Designer. ","Created By":"Esther Matthews"},{"Title":"Blend Data from Multiple Datasets","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Do you need to combine different datasets to get the results you need? This beginner course teaches you how to blend multiple data inputs using tools in the Join palette—Union, Join, Append, and Find Replace—helping you uncover meaningful insights.","Target Audience":"This course is ideal for beginners who want to learn how to combine datasets from multiple sources for their data analysis. ","Prerequisites ":"A licensed copy of Alteryx Designer. ","Learning Objectives ":"Use tools from the Join palette to blend data from multiple inputs, append records of data, and replace string values. ","Created By":"Esther Matthews"},{"Title":"Build Chained Apps","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Sometimes a workflow needs the results from another workflow before it can run. In this course, discover how easy it is to chain apps so that when one finishes, the next app in the chain starts!","Target Audience":"This course is designed for anyone who wants to use Alteryx Designer to create and chain analytic apps. ","Prerequisites ":"A licensed copy of Alteryx Designer. ","Learning Objectives ":"Create and chain analytic apps together to display a dynamic interface that updates results based on user selections. ","Created By":"Esther Matthews"},{"Title":"Build Tailored Reporting Processes with Batch Reporting ","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Do you need to create numerous customized reports and distribute them to multiple recipients? In this intermediate course, learn how to use batch reporting to make your Designer Desktop reports dynamic so they can be created and distributed automatically.","Target Audience":"This course is designed for desktop users who regularly create and distribute multiple customized reports.","Prerequisites ":"A licensed copy of Alteryx Designer. ","Learning Objectives ":"Create a batch report from a single workflow. \n\nInclude titles, maps, graphs, and tables in batch reports. ","Created By":"Esther Matthews"},{"Title":"Build Your First Classification Model in Machine Learning ","Duration":"01:30","Solutions":"[\"Intelligence Suite\"]","Description":"Join this hands-on course to build a classification model from scratch. Discover how to design effective features and evaluate model performance using machine learning tools within Alteryx Intelligence Suite. Having a foundational understanding of supervised machine learning methods is highly recommended prior to taking this course.","Target Audience":"This course is designed for anyone who wants to learn how to use Machine Learning to build classification models with Alteryx Intelligence Suite. ","Prerequisites ":"A licensed copy of Alteryx Designer.  \n\nAlteryx Intelligence Suite installation. ","Learning Objectives ":"Build a classification model with the Assisted Modeling tool in Alteryx Intelligence Suite. ","Created By":"Esther Matthews"},{"Title":"Build Your First Dynamic Workflows ","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Learn to create dynamic workflows that adapt to changing scenarios and future-proof your processes against errors. This introductory course provides theoretical insights and practical examples to enhance the flexibility of your workflows.","Target Audience":"This course is designed for anyone who wants to build flexible workflows that adapt to changing scenarios and minimize errors. ","Prerequisites ":"A licensed copy of Alteryx Designer. ","Learning Objectives ":"Describe the difference between static and dynamic workflows. \n\nTransform static workflows into dynamic ones using specific tools or by adjusting the settings of commonly used tools. ","Created By":"Esther Matthews"},{"Title":"Build Your First Macro","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Macros might be confusing at first, but once you learn to build them, they can save you time and enhance your data analytics skills. This beginner course is designed for you if you have little to no experience with macros but are well-versed in Designer Desktop or Core Certified. Discover how simple it is to create and share your first standard macro. ","Target Audience":"This course is designed for Designer users who want to start building macros to save time and enhance their data analytics skills. ","Prerequisites ":"A licensed copy of Alteryx Designer.  \n\nFamiliarity with the Interface tools palette. ","Learning Objectives ":"Build a standard macro that automates workflow processes for greater efficiency. \n\nShare a macro with other users. ","Created By":"Esther Matthews"},{"Title":" Conditional Statements Using the Formula Tool","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"This course focuses on streamlining the data preparation process in Alteryx Designer. During training, you will learn how to identify different types of conditional statements and manipulate data using conditional statement logic. You will also learn how to structure different types of conditional statements in the Formula tool’s Expression Editor. ","Target Audience":"This course is designed for users with beginner-level proficiency in Alteryx who want to use conditional statements to change and manipulate data to satisfy conditions set by users. ","Prerequisites ":"A licensed copy of Alteryx Designer. ","Learning Objectives ":"Identify different types of conditional statements: basic or multi-conditional. \n\nManipulate data using conditional statement logic. \n\nStructure different types of conditional statements in the Formula tool’s Expression Editor. ","Created By":"Esther Matthews"},{"Title":"Create Your First Analytic App ","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Need to share information but not everyone in your organization uses Designer? In this introductory course, learn how to transform your workflow into an analytic application to share information across your organization. ","Target Audience":"This course is designed for Designer users who want to build analytic apps that let others run workflows without having to create them. ","Prerequisites ":"A licensed copy of Alteryx Designer. \n\nProficiency in using Designer Desktop. ","Learning Objectives ":"Transform a workflow into an analytic app. \n\nCustomize an app interface. \n\nDebug an app to fix potential errors. ","Created By":"Esther Matthews"},{"Title":"Create Your First Report ","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Turn your data into compelling stories with Designer! This introductory course dives into the powerful reporting tools in Designer, showing you how to create static visual reports that automate the sharing of charts, tables, and maps. If you are familiar with Designer, this hands-on course will bridge the gap between data preparation and impactful reporting. Unlock the potential of these tools to streamline your reporting process and impress your audience with polished, automated results! ","Target Audience":"This course is intended for users who are already familiar with Designer and want to expand their skills by creating reports using the tools in the Reporting tool palette. ","Prerequisites ":"A licensed copy of Designer Desktop.  \n\nA basic understanding of data preparation and blending capabilities in Designer. ","Learning Objectives ":"Prepare data for use in Reporting tools. \n\nCreate data snippets. \n\nJoin and arrange snippets horizontally and vertically. \n\nOutput a dynamic PDF report.  ","Created By":"Esther Matthews"},{"Title":"Designer Cloud Foundations","Duration":"04:00","Solutions":"[\"Designer\"]","Description":"Take the next step in your cloud analytics journey! Join this half-day, hands-on course to develop essential skills for preparing and analyzing data to solve real business problems using Alteryx Designer Cloud. Along the way, you will build a workflow using some of the most commonly used tools and visualize your results in real time with the Interactive Results Grid. Perfect for advancing your Designer Cloud expertise! ","Target Audience":"This course is designed for learners with a basic understanding of the Alteryx Analytics Cloud platform who are seeking a comprehensive introduction to Designer Cloud. ","Prerequisites ":"A licensed copy of Alteryx Designer Cloud.","Learning Objectives ":"Build a workflow in Designer Cloud that analyzes data across multiple sources. \n\nAnswer specific stakeholder business questions based on your analysis. ","Created By":"Esther Matthews"},{"Title":"Designer Desktop Foundations","Duration":"04:00","Solutions":"[\"Designer\"]","Description":"Ready to dive into Alteryx Designer Desktop? If you are a beginner or have minimal experience with Designer, join this half-day, hands-on course that will guide you step-by-step as you build a robust workflow and master the essential tools from the Favorites category. By the end of the course, you will walk away with the confidence and skills to create your own data solutions and tackle real-world business questions. Come discover the power of Alteryx Designer and kick-start your journey in data analytics. ","Target Audience":"This course is designed for learners seeking a comprehensive introduction to Alteryx Designer.","Prerequisites ":"A licensed copy of Alteryx Designer. ","Learning Objectives ":"Using all the tools from the Favorites category in Designer, build a workflow that answers business questions with data. ","Created By":"Esther Matthews"},{"Title":"Designer Desktop Tips and Tricks","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Supercharge your Designer Desktop workflow! This course delivers over a dozen quick, standalone tips to save time on repetitive tasks, unlock hidden features, and leverage new tools. Perfect for users with basic Designer Desktop skills—learn shortcuts, precision hacks, and automation tricks to refine projects faster. Leave new techniques in your skillset to maximize your data analytics creativity and efficiency.","Target Audience":"This course is ideal for learners of all experience levels in Designer Desktop who want to boost their efficiency with time-saving tips, shortcuts, and advanced workflow techniques. ","Prerequisites ":"A licensed copy of Alteryx Designer Desktop. \n\nA basic understanding of the Designer Desktop interface, tools, and data preparation and blending capabilities. ","Learning Objectives ":"Build and test workflows more efficiently. \n\nExplore new tools and features. \n\nFind hidden Easter eggs. ","Created By":"Esther Matthews"},{"Title":"Explore Data Quality and Scope with Data Investigation Tools ","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"In this course, you will explore data quality and scope using Data Investigation tools. These tools will help you assess data cleanliness and analyze frequency and distribution, providing insights into the shape and characteristics of your data and guiding you in choosing the best approaches and tools for your analysis.  \n\nYou will develop the skills to identify what is significant, detect issues like outliers and null values, analyze how data is distributed within fields, and determine whether the data is ready for use in future predictive models. ","Target Audience":"This course is designed for anyone looking to assess data quality and scope using Data Investigation tools.  ","Prerequisites ":"A licensed copy of Alteryx Designer with the Data Investigation tool palette enabled. \n\nGeneral Alteryx knowledge and proficiency in data preparation, transformation, and manipulation is essential.  ","Learning Objectives ":"Explore the data quality and scope of a dataset using the Field Summary, Frequency Table, Histogram, and Distribution Analysis tools. ","Created By":"Esther Matthews"},{"Title":"Explore Data Relationship with Data Investigation Tools","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"In this course, you will explore key data relationships—correlation, collinearity, and association—to uncover patterns and influences within your dataset. By using the Data Investigation tools, you will learn how variables interact, identify redundancies, and recognize meaningful connections. These relationship types can determine how you set up a predictive model, and how to best work with your data in other analyses. ","Target Audience":"This course is designed for anyone looking to assess data relationships using Data Investigation tools.  ","Prerequisites ":"A licensed copy of Alteryx Designer with the Data Investigation tool palette enabled. \n\nGeneral Alteryx knowledge and proficiency in data preparation, transformation, and manipulation is essential. \n\nCompletion of the Explore Data Quality and Scope with Data Investigation Tools course is recommended. ","Learning Objectives ":"Use the Data Investigation tools to uncover and account for relationships and associations to determine which data elements are suitable for predictive modeling. ","Created By":"Esther Matthews"},{"Title":"Gather Insights from PDFs with CV Tools ","Duration":"01:30","Solutions":"[\"Intelligence Suite\"]","Description":"Join this hands-on course to discover how Computer Vision tools can help you extract and analyze information out of PDFs efficiently. Designer Core certification is recommended, and Intelligence Suite installation is required.","Target Audience":"This course is designed for experienced designer users who want to learn to extract information from PDF documents for use in their Designer workflows. ","Prerequisites ":"A licensed copy of Alteryx Designer. \n\nAlteryx Intelligence Suite Installation. ","Learning Objectives ":"Build a workflow using Computer Vision tools to automate the extraction of information from PDFs. ","Created By":"Esther Matthews"},{"Title":"Get Started with Alteryx Designer","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"In this course, you learn how to navigate the Designer user interface, locate essential resources, and build your first workflow to solve some common data challenges. If you are just starting your journey with Alteryx, this course will set you up for success.","Target Audience":"This course is designed for anyone who wants to learn how to use Alteryx Designer to perform analytics tasks. ","Prerequisites ":"A licensed copy of Alteryx Designer. \n\nAn Alteryx Community account is required. ","Learning Objectives ":"Navigate the Alteryx Designer user interface. \n\nLocate Alteryx resources and Help documentation. \n\nBuild your first Designer workflow. ","Created By":"Esther Matthews"},{"Title":"Get Started with Alteryx Server","Duration":"01:30","Solutions":"[\"Server\"]","Description":"Discover the power of Alteryx Server to automate your processes. In this course, which includes a demonstration, you will learn how to navigate the Server user interface and how to organize, run, and schedule workflows in Server. This course does not include hands-on activities.","Target Audience":"This course is designed for anyone who wants to learn more about Alteryx Server. ","Prerequisites ":"A license of Alteryx Server is recommended. ","Learning Objectives ":"Navigate the Server user interface. \n\nOrganize, run, and schedule workflows in Server. ","Created By":"Esther Matthews"},{"Title":"Get Started with Auto Insights","Duration":"01:30","Solutions":"[\"Auto Insights\"]","Description":"Say goodbye to static dashboards that only answer half your questions. With Alteryx Auto Insights, uncover clear, trustworthy explanations of your data to make informed decisions. Learn how to personalize your data story, leverage machine learning to surface key patterns, and understand the \"why\" behind your results. This introductory course will walk you through the core features of Auto Insights, helping you transform raw data into actionable business insights. ","Target Audience":"This course is designed for anyone who wants to take the quality of their analysis to the next level by going beyond numbers and statistics to find patterns, stories, and trends in data. ","Prerequisites ":"A licensed copy of Alteryx Auto Insights is required. ","Learning Objectives ":"Create your first Mission using Auto Insights. \n\nGenerate a PowerPoint presentation using Magic Documents. ","Created By":"Esther Matthews"},{"Title":"Get Started with Data Connection Manager ","Duration":"01:30","Solutions":"[\"Server\"]","Description":"This course teaches the foundational concepts of data connection management in Alteryx Designer and Server. During this course, you will learn about the key benefits of using Data Connection Manager (DCM), how to set up and configure DCM in Designer and Server, and how to share connections to collaborate in Server environments. ","Target Audience":"This course is designed for anyone who wants to learn how to set up and configure Data Connection Manager in Alteryx Designer and Server. ","Prerequisites ":"Knowledge of how to set up connections to databases or other data sources is recommended. \n\nKnowledge of Alteryx Server Gallery is recommended. ","Learning Objectives ":"Define the key benefits of using DCM. \n\nIdentify different ways to set up and configure DCM for Alteryx Designer and Server. \n\nIdentify how to share connections to collaborate in Server environments. ","Created By":"Esther Matthews"},{"Title":" Get Started with Designer Cloud ","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Modernize and elevate your data skills with Alteryx Designer Cloud! This beginner-friendly course gives you hands-on practice building an efficient workflow that connects seamlessly to files uploaded to Alteryx Analytics Cloud. Discover how to prep, blend, and automate your Designer Cloud workflows in a transparent, repeatable way. ","Target Audience":"This course is ideal for learners who are new to Designer Cloud and want hands-on experience building efficient, repeatable workflows in Alteryx Analytics Cloud. ","Prerequisites ":"A licensed copy of Designer Cloud. ","Learning Objectives ":"Navigate the Designer Cloud interface. \n\nRead in data and build your first workflow. \n\nUse the Interactive Results Grid for faster, guided data transformation powered by AI. ","Created By":"Esther Matthews"},{"Title":"Manipulating Spatial Objects ","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"This advanced course explores Alteryx spatial tools for creating, transforming, and analyzing spatial objects. Through hands-on activities and a case study, you will practice combining polygons, performing spatial matches, and finding nearest locations to enhance spatial analysis and decision-making. ","Target Audience":"This course is designed for users with intermediate-level proficiency in Alteryx who want to work with spatial data or do spatial analysis in Alteryx    Designer. ","Prerequisites ":"A licensed copy of Alteryx Designer. ","Learning Objectives ":"Use spatial tools to combine, transform, and analyze spatial objects for accurate data insights. ","Created By":"Esther Matthews"},{"Title":"Master Complex String Data Manipulation with RegEx ","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Gain expertise and confidence to tackle the most complex string data manipulation tasks. In the hands-on exercises in this course, unlock your ability to parse, extract, and replace targeted information from complex data strings. ","Target Audience":"This course is designed for intermediate Alteryx Designer users who want to master the RegEx tool to manipulate text patterns in data and handle complex string tasks. ","Prerequisites ":"A licensed copy of Alteryx Designer. ","Learning Objectives ":"Define regular expressions and list their important uses.​ \n\nParse and extract targeted information from complex data strings. ","Created By":"Esther Matthews"},{"Title":"Preparing Data and Writing Expressions ","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Start your journey to clean and prepare data with Alteryx Designer! This beginner-friendly course introduces you to essential data preparation tools and the power of Designer’s expression editor. You will learn how to calculate, filter, sample, and sort data with ease, setting the stage for seamless downstream analysis. If you are new to Designer, this course is the perfect way to build a strong foundation for your data workflows.  \n\nNote: This content overlaps with the Designer Desktop Foundations course, so choose the course that best fits your learning goals. ","Target Audience":"This course is designed for learners new to Alteryx Designer and want to build a solid foundation in data preparation using core tools and expressions. ","Prerequisites ":"A licensed copy of Alteryx Designer. ","Learning Objectives ":"Cleanse and prepare imperfect data for use in downstream analysis. \n\nWrite expressions in the Formula tool. ","Created By":"Esther Matthews"},{"Title":"Reshape Your Data with Parse and Transform Tools ","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Unlock the full potential of your data with Alteryx Designer! Dive into transformation techniques to parse datasets into columns, pivot data, and summarize key metrics. Learn how to reshape and enrich your data to uncover valuable insights and answer critical business questions. If you are ready to go beyond the basics, this course builds on foundational skills (including some overlap with the Translate Excel Processes to Designer Desktop course) to help you master powerful data transformation tools. ","Target Audience":"This course is intended for users who are comfortable with the basics of Alteryx Designer and want to advance their skills in transforming, reshaping, and enriching data for deeper analysis. ","Prerequisites ":"A licensed copy of Alteryx Designer ","Learning Objectives ":"Parse data to rows and columns with delimiters. \n\nPivot the orientation of data to better suit your analysis. \n\nSummarize data to answer business questions. ","Created By":"Esther Matthews"},{"Title":"Save Time with Batch Macros ","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Are you using numerous Filter tools to run separate processes on different groups of data? Discover how to harness the power of batch macros to group data into batches and process them one at a time. In this course, you will learn when to consider and how to both create and share a batch macro. Having prior knowledge of standard macros is highly recommended to enhance your learning experience in this course. ","Target Audience":"This course is ideal for users who are familiar with standard macros and want to streamline complex workflows by learning how to build and apply batch macros in Designer Desktop. ","Prerequisites ":"A licensed copy of Alteryx Designer \n\nProficiency with the Interface tool palette and creating Macros in Designer ","Learning Objectives ":"Create a macro that streamlines repetitive workflow processes by batching record groups. \n\nShare a macro with other users. ","Created By":"Esther Matthews"},{"Title":"See the Future: Time Series Modeling ","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Ever wonder how to anticipate what is next using your data? In this interactive course, you will uncover the secrets of time series analysis and forecasting. Learn how to identify patterns, analyze trends, and predict future behavior based on past observations. Ideal for anyone working with time-based data, this course requires a basic understanding of predictive models and a prior download of the Predictive tools. ","Target Audience":"This course is designed for users who work with time-based data and want to learn time series analysis and forecasting techniques. ","Prerequisites ":"A licensed copy of Alteryx Designer \n\nPredictive tools installation ","Learning Objectives ":"Describe the main components of time series analysis. \n\nCreate a time-based model using historical data. ","Created By":"Esther Matthews"},{"Title":"Text Mining and Sentiment Analysis in AIS ","Duration":"01:30","Solutions":"[\"Intelligence Suite\"]","Description":"Qualitative data is often overlooked in the world of numerical analysis. This course covers the fundamentals of working with unstructured text data, helping you identify patterns like trends, sentiments, and key topics. It is ideal if you want to perform analysis on customer feedback, reviews, surveys, or other text-based data, and you have little experience in natural language processing and text mining. A solid foundation in Designer Desktop is required. ","Target Audience":"This course is ideal for experienced Designer Desktop users who want to learn to analyze patterns and sentiment in unstructured text data. ","Prerequisites ":"A licensed copy of Alteryx Designer \n\nAlteryx Intelligence Suite Installation ","Learning Objectives ":"Use text mining tools to uncover themes, sentiments, and key insights from unstructured data. ","Created By":"Esther Matthews"},{"Title":"The Favorites Tools ","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"The Favorites Tools Workshop is a hands-on session designed to help you master the most commonly used tools in Alteryx Designer. Through practical exercises, you will prepare, join, and analyze data to solve real-world business scenarios. Guided by your instructor, you’ll build a workflow from scratch using only the Favorites category, gaining confidence in the core building blocks of Alteryx. ","Target Audience":"This course is designed for anyone who wants to learn how to use Alteryx Designer to perform analytics tasks. ","Prerequisites ":"A licensed copy of Alteryx Designer.","Learning Objectives ":"Build a workflow that includes tools from the Favorites category in Alteryx Designer. ","Created By":"Esther Matthews"},{"Title":"Translate Excel Processes to Designer Cloud","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Ready to move your Excel files into the Cloud? In this intermediate course, discover how to translate your most-used Excel functions into automated, repeatable workflows in Designer Cloud. Replace tedious data refreshes and manipulations with visual, auditable processes that save you time and effort. This hands-on course will show you how to revolutionize your approach to cloud data analysis! A basic understanding of Designer Cloud is required. ","Target Audience":"This course is designed for users who regularly work in Excel and are ready to modernize their workflows by building automated, repeatable processes in Designer Cloud. ","Prerequisites ":"A licensed copy of Designer Cloud \n\nA basic understanding of Designer Cloud ","Learning Objectives ":"Transfer common, manual processes from Microsoft Excel to a Designer Cloud workflow. ","Created By":"Esther Matthews"},{"Title":"Translate Excel Processes to Designer Desktop","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Ready to break free from the manual grind of Excel? In this intermediate course, discover how to translate your most-used Excel functions into automated, repeatable workflows in Alteryx Designer Desktop. Replace tedious data refreshes and manipulations with visual, auditable processes that save you time and effort. A basic understanding of Designer is required. ","Target Audience":"This course is ideal for Excel users who are ready to streamline their work by building automated, repeatable workflows in Alteryx Designer Desktop. ","Prerequisites ":"A licensed copy of Alteryx Designer is required. \n\nA basic understanding of Designer is required. ","Learning Objectives ":"Transfer common, manual processes from Microsoft Excel to an automation-ready Designer Desktop workflow. ","Created By":"Esther Matthews"},{"Title":"Unlock Location-Based Insights with Spatial Analytics","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Join this introductory course and learn how to use Spatial tools to build a workflow that gives insights into geospatial information. ","Target Audience":"This course is designed for analysts and business users who need to prepare and analyze location-based data using Alteryx Designer. ","Prerequisites ":"A licensed copy of Alteryx Designer is required \n\nA basic understanding of Designer is required ","Learning Objectives ":"Analyze spatial data to determine locations, routes, and areas on a map. \n\nConstruct a trade area using spatial data. ","Created By":"Esther Matthews"},{"Title":"Workflow and Configuration Best Practices","Duration":"01:30","Solutions":"[\"Designer\"]","Description":"Best practices for new users! Discover settings that improve runtime and performance. Customize your tool palette and navigate Alteryx Designer Desktop with shortcuts. Share the genius of your workflow\u0027s logic with proper documentation.","Target Audience":"This course is ideal for new Alteryx Designer users who want to improve performance, streamline navigation, and apply best practices from the start. ","Prerequisites ":"A licensed copy of Alteryx Designer is required.","Learning Objectives ":"Efficiently build workflows in Alteryx Designer. \n\nImprove your workflow’s logic and shareability. ","Created By":"Esther Matthews"}];
